import { defineMessages } from 'react-intl';

export const scope = 'app.containers.stockTransfer';

export default defineMessages({
  date: {
    id: `${scope}.date`,
    defaultMessage: 'Date',
  },
  stockTransferNum: {
    id: `${scope}.stockTransferNum`,
    defaultMessage: 'Stock Transfer Number',
  },
  inwardBranchCode: {
    id: `${scope}.inwardBranchCode`,
    defaultMessage: 'Inward Branch Code',
  },
  inwardBranchName: {
    id: `${scope}.inwardBranchName`,
    defaultMessage: 'Inward Branch Name',
  },
  outwardBranchCode: {
    id: `${scope}.outwardBranchCode`,
    defaultMessage: 'Outward Branch Code',
  },
  outwardBranchName: {
    id: `${scope}.outwardBranchName`,
    defaultMessage: 'Outward Branch Name',
  },
  totalPart: {
    id: `${scope}.totalPart`,
    defaultMessage: 'Total Part',
  },
  partValue: {
    id: `${scope}.partValue`,
    defaultMessage: 'Part Value',
  },
  transferStatus: {
    id: `${scope}.transferStatus`,
    defaultMessage: 'Transfer Status',
  },
  delivered: {
    id: `${scope}.delivered`,
    defaultMessage: 'Delivered',
  },
  requested: {
    id: `${scope}.requested`,
    defaultMessage: 'Requested',
  },
  inTransit: {
    id: `${scope}.inTransit`,
    defaultMessage: 'In transit',
  },
  readyForDispatch: {
    id: `${scope}.readyForDispatch`,
    defaultMessage: 'Ready for dispatch',
  },
  approved: {
    id: `${scope}.approved`,
    defaultMessage: 'Approved',
  },

});
